Defendant Yumari A Vega in court with attorney Victoria Mccandless.  Defendant Yumari A Vega in custody.  
James W. Frisch appeared for the State of Wisconsin.  
Deputy Court Clerk: dds.

Amended Information filed.  Defense counsel acknowledged receipt of a copy of the Amended Information, waived its reading and entered a plea of not guilty on behalf of the defendant.    

Charge amended to: 
COUNT 1: DISORDERLY CONDUCT, contrary to Wisconsin Statutes section(s) 947.01(1), 939.51(3)(c), a Class B Misdemeanor
COUNT 2: RESISTING AN OFFICER, contrary to Wisconsin Statutes section(s) 946.41(1), 939.51(3)(a), a Class A Misdemeanor

Defendant prepared to enter change of plea.  Hearing proceeded.  Negotiations set forth by the state.

COUNTS 1 and 2:  The defendant was advised of her constitutional rights and maximum penalties, waived all rights, plead GUILTY and was examined as to the plea.  Plea Questionnaire/Waiver of Rights, Addendum to Plea Questionnaire, and Jury Instructions received and filed.  The parties stipulate to the complaint as a factual basis for the plea.  The Court found the defendant guilty and ordered entry of Judgment of Conviction.  

Sentencing proceeded.  Statements made by State, defense, and defendant. 
 
COUNT 1:  The Court sentenced the defendant to serve 3 MONTHS in the House of Correction with Huber release for employment and school, with credit for 0 days.  Good time allowed.

COUNT 2:  The Court sentenced the defendant to serve 6 MONTHS in the House of Correction, Consecutive to Count 1, with Huber release for employment and school, with credit for 46 days.  Good time allowed.

The Court STAYED these sentences and placed the defendant on probation for a period of 1 YEAR with the following conditions.

 AS TO BOTH COUNTS:  CONDITIONS OF PROBATION:
 - Complete 40 hours(total) of community service;
 - Participate in Parenting counseling;
 - AODA assessment; treatment, if needed;
 - No alcohol, No controlled substances unless for treatment of mental health or physical needs as prescribed by a licensed physician;
 - Urine screens;
 - Seek and maintain employment;
 - Obtain GED;
 - Be given job and vocational training;
 - Cognitive thinking intervention counseling;
 - Mental health assessment; treatment, if needed;
 - Pay all applicable mandatory surcharges, costs, fees, and assessments by the end of probation period or any remaining balance shall convert to civil judgment;

Appeal rights given. 
Filed;
- Pretrial Incarceration Credit;
- Notice of Right to Seek Postconviction Relief.
